  \"2014-11-13T17:06:24.928181\",\n\t\"name\": \"u-s-forest-service-periodical-cicada-broods\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A map service on the www depicting periodical
  cicada distribution and expected year of emergence by cicada brood and county. The
  periodical cicada emerges in massive groups once every 13 or 17 years and is completely
  unique to North America. There are 15 of these mass groups, called broods, of periodical
  cicadas in the United States. This county-based data, complied by the USFS Northern
  Research Station, depict where and when the different broods of periodical cicadas
  are likely to emerge in the US through 2031. The data was compiled for the 2011
  publication entitled \"Avian predators are less abundant during periodical cicada
  emergences, but why?\" (Koenig et al. http://dx.doi.org/10.1890/10-1583.1) using
  data from periodical cicada publications listed below. 1) Marlatt, C. L. 1907. \"The
  periodical cicada\". Bulletin of the USDA Bureau of Entomology 71:1u2013181. 2)
  Simon, C. 1988. \"Evolution of 13- and 17-year periodical cicadas\". (Homoptera:
  Cicadidae). Bulletin of the Entomological Society of America 34:163u2013176. 3)
  Liebhold, A. M., Bohne, M. J., and R. L. Lilja. 2013. \"Active Periodical Cicada
  Broods of the United States\". USDA Forest Service Northern Research Station, Northeastern
  Area State and Private Forestry.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
